if(!isNaN(data.seminv_inn)){
  data.isButtonTriggered = true;
  var url = Alfresco.constants.PROXY_URI + 'citeck/invoice/get-contractor-by-inn?inn='+data.seminv_inn;
  
  Alfresco.util.Ajax.jsonPost({
    url: url,
    successCallback: {
      fn: function(response) {
        if (response && response.json && response.json.contractorNodeRef) {
          var result = response.json.contractorNodeRef;
          data._seminv_inn = result;
          instance.triggerChange();
        }
      }
    }
  });
}
